import React from 'react';

function AboutMe() {
  return (
    <section id="about-me">
      <h2>About Me</h2>
      <img src="https://i.pinimg.com/originals/04/3d/f2/043df269449b5f3eddef07969b4ab36e.png" alt="Developer Avatar" />
      <p>Hello! My name is Kyla, and I am an incredibly eager to learn! I am a novice developer, looking to make a chaange and tell a stroy with my code. I would love for you to check out the rest of my page and tell me what you think!</p>
    </section>
  );
}

export default AboutMe;
